Using the latest docker image \([nkoenig / subt-virtual-testbed](https://cloud.docker.com/repository/registry-1.docker.io/nkoenig/subt-virtual-testbed)\), attempting to report an artifact location to the base\_station causes IGN to throw an exception:

\[Dbg\] \[[VisibilityRfModel.cc:80](http://VisibilityRfModel.cc:80)\] Range: 13.0001, Exp: 2.5, TX: 20, RX: -47.8487  
Exception occurred in a local callback on topic \[/world/tunnel\_qual\_ign/pose/info\] with message \[header \{  
stamp \{  
sec: 529  
nsec: 308000000  
\}  
\}  
pose \{  
name: "staging\_area"  
id: 16  
position \{  
\}  
orientation \{  
w: 1  
\}  
\}

….

This is done at startup, right after getting the artifact origin but before anything else using a dummy position of 0,0,0 with the provided sample code:

// report object to scoring server  
ignition::msgs::Pose pose;  
pose.mutable\_position\(\)->set\_x\(0\);  
pose.mutable\_position\(\)->set\_y\(0\);  
pose.mutable\_position\(\)->set\_z\(0\);

// fill the type and pose  
subt::msgs::Artifact artifact;

// set type  
artifact.set\_type\(static\_cast<uint32\_t>\(\(uint32\_t\)0\)\);

// set pose  
artifact.mutable\_pose\(\)->CopyFrom\(pose\);

// serialize the artifact  
std::string serializedData;  
if \(!artifact.SerializeToString\(&serializedData\)\) \{  
std::cerr << "ReportArtifact\(\): Error serializing message\\n" << artifact.DebugString\(\) << std::endl;  
\}

// Report it.  
comms\_client->SendTo\(serializedData, kBaseStationName\);

We are having a problem where our calls to lookupTransform are always returning the most recent transform, even when we specify a time in the past. The exact same code works as expected in Gazebo.

To figure out what was going on I output the transform offsets before and after a delay, with the lookup targeting the same original timestamp in both instances. Data “A” is the first call, and data “B” is after the delay has passed.

![](data/bitbucket.org/repo/8ze6Mjd/images/324484230-image.png)
“A” and “B” in the above graph use the targeted transform timestamp as the X-axis, while “B-ros” substitutes the current ROS time for the X-axis. As expected, “A” and “B” are identical while “B-ros” is shifted right by the delay of 4.5 seconds I used.

The same code in Ignition performs differently however:

![](data/bitbucket.org/repo/8ze6Mjd/images/3467047115-image.png)
Here the “A” and “B-ros” data are aligned: the returned transform for “B” is for the current time in ros, rather than the historic transform data.

‌

For reference, we are initializing  a listener when our node is constructed:

```
listener = new tf::TransformListener();
```

And when we do the lookup later:

```
tf::StampedTransform transform;

if(!listener->waitForTransform(target_frame,cloud_msg->header.frame_id,cloud_msg->header.stamp,ros::Duration(3.0)))
{
    printf("Failed to acquire transform!\n");
    return;
}

listener->lookupTransform(target_frame,cloud_msg->header.frame_id,cloud_msg->header.stamp,transform);
```

where cloud\_msg is of type “const sensor\_msgs::PointCloud2ConstPtr& cloud\_msg” \(It’s a subscription to the LIDAR points topic\)

I am reporting artifacts via this function:

‌

```c++
  public: bool ReportArtifact(const uint32_t _type,
                               const ignition::msgs::Pose &_pose)
  {
    subt::msgs::Artifact artifact;
    artifact.set_type(_type);
    artifact.mutable_pose()->CopyFrom(_pose);
    return this->client->SendTo(artifact.SerializeAsString(), subt::kBaseStationName);
  }
```

And so far I am permanently getting “false” and server does not see any report attempt - any suggestion what I am doing wrong? I call `start_scoring`:

‌

```c++
  public: bool start_scoring()
  {
    ignition::msgs::Boolean req;
    ignition::msgs::Boolean rep;
    unsigned int timeout = 5000;
    bool result;
    req.set_data(true);
    return this->node.Request("/subt/start", req, timeout, rep, result); 
  }
```

before that and it works fine

‌

```
[Msg] Scoring has Started
```

Thanks in advance for any hit

Martin
